// ФИО, возраст, адрес (город и название улицы), рост, вес, номер телефона и email-адрес


// console.log(array);
// const data_1 = array;
const Table = ({data}) => {
  return (
    <div className="mainTable">
      <table>
        <thead>
          <tr>
            <th>Имя</th>
            <th>Возраст</th>
            <th>Пол</th>
          </tr>
        </thead>
        <tbody>
          {data.map(item => (
            <tr key={item.id}>
              <td>item.firstName</td>
              <td>item.age</td>
              <td>item.gender</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default Table;
